            <div className="ArtistPage_ul_container">
            <ul className="ArtistPage_ul">
                <li className="ArtistPage_li">Exemple 1</li>
                <li className="ArtistPage_li">Exemple 1</li>
                <li className="ArtistPage_li">Exemple 1</li>
            </ul>
            </div>
        </div>
    )
}

export default ArtistPage;
